import React from 'react';
import { Link } from 'react-router-dom';

export default function DeviceDropDown(props){
const { device } = props;

    return (
             <div key={device._id} className="card">

                <Link to={`/deviceType/${device._id}`}>
                </Link>

            <div>
                <select>
                    <option selected="true"> Select Device</option>
                    <option></option>
                </select>
            </div>

            </div>
    );
}
